        static void MakeMatrices(float[] DNA, int[] layers)
        {
            float[][,] matrices = new float[layers.Length - 1][,];
            
            int position = 0;
            var gpu = Gpu.Default;
            
            int[] l = layers;
            
            for (int i = 0; i < layers.Length - 1; i++)
            {
                matrices[i] = new float[layers[i + 1], layers[i]];
                
                for (int row = 0; row < matrices[i].GetLength(0); row++)
                    for (int column = 0; column < matrices[i].GetLength(1); column++)
                        matrices[i][row, column] = DNA[position++];
            }
        }

        static float[] GetRandomDNA(int[] layers)
        {
            Random rand = new Random();

            int length = 0;

            for (int i = 0; i < layers.Length - 1; i++)
                length += layers[i] * layers[i + 1];

            float[] dna = new float[length];

            for (int i = 0; i < dna.Length - 1; i++)
                dna[i] = (float)rand.Next(-99, 100) / 100;

            return dna;
        }

        static int GetMaxKey(float[] arr)
        {
            int key = 0;
            float last = 0;

            for (int i = 0; i < arr.Length; i++)
            {
                if (arr[i] > last)
                {
                    key = i;
                    last = arr[i];
                }
            }

            return key;
        }
